import Banner from "./sections/Banner";
import Navbar from "./sections/Navbar";
import Sponsors from "./sections/Sponsors";

const Home = () => {
    return ( 
        <>
            <Navbar />
            <div className="w-full">
                <Banner />
                <div className="flex justify-center items-center">
                    <Sponsors />
                </div>
            </div>
        </>
     );
}
 
export default Home;
